(ev, el, s) => {
      const isActive = s.isActive
      s.update({
        isActive: !isActive,
        upvotes: isActive ? s.upvotes - 1 : s.upvotes + 1
      })
    }

Input.onInput:
(e, el, state) => {
          const value = e.target.value.trim().toLowerCase()
          const filtered = state.data.filter(item =>
            item.toLowerCase().includes(value))
          state.replace({
            searchValue: value,
            filtered: filtered
          })
        }

